import React from 'react';

import './sidebar.css';

const Sidebar = () => {
    return (
        <nav class="sidebar">
            <h3 class="sidebar__header">Категории</h3>
            <ul class="sidebar__list">
                <li class="sidebar__item">
                    <a class="sidebar__link" href="#">Хлеб</a>
                </li>
            </ul>
        </nav>
    );
}

export default Sidebar
